export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},XRU1ZecUTu:{data:{id:2072,attributes:{imdbId:"tt3496892",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTEyNjI2MTczMjdeQTJeQWpwZ15BbWU4MDA3MTcyNzEx._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:2735,attributes:{title:e,plot:"A decade after Cathy, Christopher, and Carrie escaped from their grandparents' attic at Foxworth Hall, Petals on the Wind continues to follow the twisted plight of the family as they attempt to put their sordid past behind them, but soon discover certain secrets can't be left behind. When Cathy finds herself in an abusive relationship with a fellow dancer, Julian, Christopher and Cathy are forced to face the forbidden feelings they developed for one another while coming of age during captivity. But when tragedy strikes the Dollangangers once again, Cathy returns to Foxworth Hall to confront her grandmother and seek revenge on her mother with a plan to seduce her husband Bart. When Christopher runs to Cathy's side, the two are determined to start over again - together.",slug:"petals-on-the-wind"}}},books:{data:[{id:10309,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:l,subtitle:c}},{id:10310,attributes:{title:e,description:m,thumbnail:n,authors:[a],firstBook:d,published:o,publisher:p,subtitle:c}},{id:10311,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:l,subtitle:c}},{id:10312,attributes:{title:e,description:m,thumbnail:n,authors:[a],firstBook:d,published:o,publisher:p,subtitle:c}},{id:10313,attributes:{title:"The Flowers in the Attic Saga",description:"V.C. Andrews’s bestselling Flowers in the Attic saga has been enjoyed by millions of readers for more than thirty years. Now, all five books are available together in this new collection! In Flowers in the Attic and Petals on the Wind, Chris, Cathy, Cory, and Carrie had the perfect lives—until a tragic accident changed everything. Now they are trapped in their grandparents’ attic, waiting for their mother to figure out what to do next. As the days turn into weeks and the weeks turn into months, the unspeakable horrors that plague them are rivaled only by the sinful jealousies that begin to rise. In If There Be Thorns and Seeds of Yesterday, Cathy and Chris have moved on from their days in the attic, but the sins and secrets of their past keep catching up to them. Now their children may be doomed to repeat their mistakes. In the Garden of Shadows prequel, young Olivia arrives at Foxworth Hall thinking her marriage to handsome Malcolm will bring the joy she has longed for. But in the gloomy mansion filled with festering desires and forbidden passions, a shocking secret lives. A secret that will taint the Foxworth family for generations to come.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=A5EGvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2016-10-18",publisher:"Simon Pulse",subtitle:"Flowers in the Attic\u002FPetals on the Wind; If There Be Thorns\u002FSeeds of Yesterday; Garden of Shadows"}}]}}},meta:{}}},prerenderedAt:1681309567184}}("V.C. Andrews","movie","",null,"Petals on the Wind","series",1,"Flowers in the Attic\u002FPetals on the Wind","Contains \"Flowers in the Attic\" in which four children are locked into the attic of their grandmother's home after the death of their father, and \"Petals on the Wind\" in which Cathy discovers that she has the power to revenge those childhood years lockedin an attic with her brothers and sister.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p7lyfH_NLYIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2009-11-10","Simon and Schuster","The captivating and unforgettable saga of the Dollanganger family continues in Petals On the Wind, the New York Times bestselling sequel to Flowers in the Attic and the inspiration behind the Lifetime original movie and “tortured love story” (Variety). Forbidden love comes into full bloom. For three years they were kept hidden in the eaves of Foxworth Hall, their existence all but denied by a mother who schemed to inherit a fortune. For three years their fate was in the hands of their righteous, merciless grandmother. They had to stay strong…but in their hopeless world, Cathy and her brother, Christopher, discovered blossoming desires that tumbled into a powerful obsession. Now, with their frail sister, Carrie, they have broken free and scraped together enough for three bus tickets and a chance at a new life. The horrors of the attic are behind them…but they will carry its legacy of dark secrets forever.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=y2vqDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2020-07-07","Gallery Books"))